function autoFill() {
  var rand3 = Math.floor(Math.random() * characters.length);
  var content = characters[rand3]; 
  document.getElementById('input1').value = content;

  if ( content === content ){
    var translation = details.find(translation => translation.chinese === content);
    document.getElementById("input2").innerHTML = "&#8594; " + content;
    document.getElementById("input3").innerHTML = "It means: " + translation.english + "."; 
    document.getElementById("input4").innerHTML = "Pinyin: " + translation.pinyin + ".";
  }
}